import React, { useState } from 'react';
import './style-verificator.css';

function BugManagementPage() {
    const [bugs, setBugs] = useState([]);
    const [newBugTitle, setNewBugTitle] = useState('');
    const [newBugDescription, setNewBugDescription] = useState('');
    const [newBugUrgency, setNewBugUrgency] = useState('');

    const addBug = () => {
        if (newBugTitle && newBugDescription) {
            const currentDate = new Date().toLocaleDateString();
            setBugs([...bugs, { title: newBugTitle, description: newBugDescription, date: currentDate, urgency: newBugUrgency }]);
            setNewBugTitle('');
            setNewBugDescription('');
            setNewBugUrgency('');
        }
    };

    const deleteBug = (index) => {
        const updatedBugs = bugs.filter((_, i) => i !== index);
        setBugs(updatedBugs);
    };

    const editBug = (index) => {
        const currentBug = bugs[index];

        setNewBugTitle(currentBug.title);
        setNewBugDescription(currentBug.description);

        const updatedBugs = bugs.filter((_, i) => i !== index);
        setBugs(updatedBugs);
    };

    return (
        <div className='bug-management-page'>

            <div className='bug-management-container'>
                <h2>Management Bug-uri</h2>
                <div>
                    <h3>Add Bug</h3>
                    <div>
                        <label htmlFor="bugTitle">Bug Title:</label>
                        <input className='textarea'
                            placeholder="Bug Title"
                            value={newBugTitle}
                            onChange={(e) => setNewBugTitle(e.target.value)}
                        />
                    </div>
                    <div>
                        <label htmlFor="bugDescription">Bug Description:</label>
                        <input className='textarea'
                            placeholder="Bug Description"
                            value={newBugDescription}
                            onChange={(e) => setNewBugDescription(e.target.value)}
                        />
                    </div>
                    <div>
                        <label htmlFor="Bug Urgency">Bug Urgency:</label>
                        <select className="select" value={newBugUrgency} onChange={(e) => setNewBugUrgency(e.target.value)}>
                            <option value="Normal">Normal</option>
                            <option value="High">High</option>
                            <option value="Critical">Critical</option>
                        </select>
                    </div>

                    <button className="button" onClick={addBug}>Add Bug</button>
                </div>
            </div>
            <div className='bug-list-container'>
                <h3>Bug List</h3>
                <ul>
                    {bugs.map((bug, index) => (
                        <div className="bug-container" key={index}>

                                <p><strong>Title:{bug.title}</strong></p>
                                <p><strong>Description:</strong>{bug.description}</p>
                                <p><strong>Date:</strong>{bug.date}</p>
                                <p><strong>Urgency:</strong>{bug.urgency}</p>
                                <div>
                                    <button className="button" onClick={() => deleteBug(index)}>Delete Bug</button>
                                    <button className="button" onClick={() => editBug(index)}>Edit Bug</button>
                                </div>

                        </div>
                    ))}
                </ul>
            </div>
        </div>
    );
}

export default BugManagementPage;
